import React from 'react';
import Button from './button';

function App() {
  return (
    <div>
      <h1>Welcome to My Simple Webpage</h1>
      <p>This is a simple webpage created with React and JavaScript.</p>
      <Button />
    </div>
  );
}

export default App;
